  [],\n\t\"revision_timestamp\": \"2015-11-25T17:37:25.083652\",\n\t\"name\": \"mls-aura-level-2-diagnostics-miscellaneous-grid-v004\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"ML2DGM is the EOS Aura Microwave Limb Sounder
  (MLS) product containing the minor frame diagnostic quantities on a miscellaneous
  grid. These include items such as tangent pressure, chi-square describing various
  fits to the measured radiances, number of radiances used in variious retrieval phases,
  etc. This product contains a second auxillary file which includes cloud-induced
  radiances inferred for selected spectral channels. The current version is 4.2. Data
  coverage is complete from August 8, 2004 to current. Spatial coverage is near-global
  (-82 deg. to +82 deg. latitude), with each profile spaced 1.5 deg. or ~165 km along
  the orbit track (roughly 15 orbits per day). Vertical resolution varies between
  species and typically ranges from 3 - 6 km. Users of the ML2DGM data product should
  read the EOS MLS Level 2 Version 4 Quality Document for more information (http://mls.jpl.nasa.gov/data/v4-2_data_quality_document.pdf).nn
  \     Users are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
  to obtain updates and information about this data product.nn      The data are stored
  in the version 5 Hierarchical Data Format, or HDF5. Each file contains sets of HDF5
  dataset objects (n-dimensional arrays) for each diagnostics measurement. The dataset
  objects represent data and geolocation fields; included in the file are file attributes
  and metadata. There are two files per day (MLS-Aura_L2AUX-DGM* and MLS-Aura_L2AUX-Cloud*).\",\n\t\"license_title\":
